import React from 'react'

function DibujoModelos(props) {
   let modelo=null
    switch (props.modelos) {
        case "Botone":
        modelo="nookweb/src/components/Respaldo/Respaldo/Croquis/DibujoModelos/Botone.svg"

            break;
    
        default:
            modelo=null;
            break;
    }

    return (
        <div>
            {modelo}
        </div>
    )
}

export default DibujoModelos
